		// de la izquierda en el segundo frame de Atenas (frame 2) para
		// retornar al primer frame de Atenas (frame 1)
		this.atenas.addEventListener("click", ir_atenas_1.bind(this)); // Se asocia el boton a la funcion 
		this.back_athens_1.addEventListener("click", ir_atenas_1.bind(this));
		
		// Se unen dos botones a la funcion de ir al frame 2, el
		// primero es la flecha de la derecha del primer frame de 
